  if(isFencedState()) {
    LOG.info("State store is in Fenced state. Can't store RM Delegation " +
             "Token Master key.");
    return;
  }
  try {
    storeRMDTMasterKeyState(delegationKey);
  } catch (Exception e) {
    notifyStoreOperationFailed(e);
  }
}

